  render() {
    const test = articleData[0].instructions;
    for (let i = 0; i < test.length; i++) {
      console.log(i);
    }
    return (
      <div>
        <Navbar />
        <div id="nav-filler"></div>
        <Headline />
        <Article
          category={articleData[0].category}
          title={articleData[0].title}
          subtitle={articleData[0].subtitle}
          description={articleData[0].description}
          instructions={test}
          img={articleData[0].img}
          alt={articleData[0].alt}
        />
        {console.log(articleData[0].instructions)}
      </div>
    );
  }
}

export default App;
